import { yellow } from "@material-ui/core/colors";
import { sizeHeight } from "@material-ui/system";

export const styles = () => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      background: "yellow"
    }
  },
  root: {
    background: "blue"
  },
  container: {
    background: "green",
    display: "flex",
    maxWidth: 1280,
    margin: "auto"
  },
  lowerNav: {
    "& > $container": {
      height: 66
    }
  },
  upperNav: {
    "& > $container": {
      height: 44
    }
  },
  emptySpacing: {
    flexGrow: 1
  },
  navActionGroup: {
    display: "flex",
    '& > div': {
      width: 100,
      textAlign: 'center',
    }
  }
});
